d that it has been set correctly, i.e. the value can only be changed at `pipeline_length` offset }, _ => false,
} validator/{validator_address}/state: match (pre_state, post_state) { (None, Some(post)) => { // - check that all other required validator fields have been initialized // - check that the `post` state is set correctly: // - the state should be set to `pending` in the current epoch and `candidate` at pipeline offset // - insert into or update `new_validators` accumulator }, (Some(pre), Some(post)) => { // - check that a validator has been correctly deactivated or reactivated // - the `state` should only be changed at `pipeline_length` offset // - if the `state` becomes `inactive`, it must have been `pending` or `candidate` // - if the `state` becomes `pending`, it must have been `inactive` // - if the `state` becomes `candidate`, it must have been `pending` or `inactive` }, _ => false,
} validator/{validator_address}/total_deltas: find the difference between the pre-state and post-state values and add it to the total_deltas accumulator and update total_stake_by_epoch, expected_voting_power_by_epoch and expected_total_voting_power_delta_by_epoch validator/{validator_address}/voting_power: find the difference between the pre-state and post-state value and insert it into the voting_power_by_epoch accumulator bond/{bond_source}/{bond_validator}/delta: for each difference between the post-state and pre-state values: if the difference is not in epoch n or n + pipeline_length, panic find slashes for the bond_validator, if any, and apply them to the delta value add it to the bond_delta accumulator unbond/{unbond_source}/{unbond_validator}/deltas: for each difference between the post-state and pre-state values: if the difference is not in epoch n or n + unboding_length, panic find slashes for the bond_validator, if any, and apply them to the delta value add it to the unbond_delta accumulator validator_set: set the accumulators validator_set_pre and validator_set_post total_voting_power: find the difference between the post-state and pre-state add it to the total_voting_power_delta_by_epoch accumulator PoS account's balance: find the difference between the post-state and pre-state add it to the balance_delta accumulator No other storage key changes are permitted by the VP. After the storage keys iteration, we check the accumulators: For each total_deltas, there must be the same delta value in bond_delta. For each bond_delta, there must be validator's change in total_deltas. Check that all positive unbond_delta also have a total_deltas update. Negative unbond delta is from withdrawing, which removes tokens from unbond, but doesn't affect total deltas. Check validator sets updates against validator total stakes. Check voting power changes against validator total stakes. Check expected voting power changes against voting_power_by_epoch. Check expected total voting power change against total_voting_power_delta_by_epoch. Check that the sum of bonds and unbonds deltas is equal to the balance delta. Check that all the new validators have their required fields set and that they have been added to the validator set

