The system parameters are written into the storage to allow for their changes. Additionally, each validator may record a new parameters value under their sub-key that they wish to change to, which would override the systems parameters when more than 2/3 voting power are in agreement on all the parameters values. The validators' data are keyed by the their addresses, conceptually: type Validators = HashMap<Address, Validator>; Epoched data are stored in the following structure: struct Epoched<Data> { /// The epoch in which this data was last updated last_update: Epoch, /// Dynamically sized vector in which the head is the data for epoch in which /// the `last_update` was performed and every consecutive array element is the /// successor epoch of the predecessor array element. For system parameters, /// validator's consensus key and state, `LENGTH = pipeline_length + 1`. /// For all others, `LENGTH = unbonding_length + 1`. data: Vec<Option<Data>>
} Note that not all epochs will have data set, only the ones in which some changes occurred. To try to look-up a value for Epoched data with independent values in each epoch (such as the active validator set) in the current epoch n: let index = min(n - last_update, pipeline_length) read the data field at index: if there's a value at index return it else if index == 0, return None else decrement index and repeat this sub-step from 1. To look-up a value for Epoched data with delta values in the current epoch n: let end = min(n - last_update, pipeline_length) + 1 sum all the values that are not None in the 0 .. end range bounded inclusively below and exclusively above To update a value in Epoched data with independent values in epoch n with value new for epoch m: let shift = min(n - last_update, pipeline_length) if shift == 0: data[m - n] = new else: for i in 0 .. shift range bounded inclusively below and exclusively above, set data[i] = None rotate data left by shift set data[m - n] = new set last_update to the current epoch To update a value in Epoched data with delta values in epoch n with value delta for epoch m: let shift = min(n - last_update, pipeline_length) if shift == 0: set data[m - n] = data[m - n].map_or_else(delta, |last_delta| last_delta + delta) (add the delta to the previous value, if any, otherwise use the delta as the value) else: let sum to be equal to the sum of all delta values in the i in 0 .. shift range bounded inclusively below and exclusively above and set data[i] = None rotate data left by shift set data[0] = data[0].map_or_else(sum, |last_delta| last_delta + sum) set data[m - n] = delta set last_update to the current epoch The invariants for updates in both cases are that m - n >= 0 and m - n <= pipeline_length. For the active validator set, we store all the active and inactive validators separately with their respective voting power: type VotingPower = u64; /// Validator's address with its voting power.
#[derive(PartialEq, Eq, PartialOrd, Ord)]
struct WeightedValidator { /// The `voting_power` field must be on top, because lexicographic ordering is /// based on the top-to-bottom declaration order and in the `ValidatorSet` /// the `WeighedValidator`s these need to be sorted by the `voting_power`. voting_power: VotingPower, address: Address,
} struct ValidatorSet { /// Active validator set with maximum size equal to `max_active_validators` active: BTreeSet<WeightedValidator>, /// All the other validators that are not active inactive: BTreeSet<WeightedValidator>,
} type ValidatorSets = Epoched<ValidatorSet>; /// The sum of all active and inactive validators' voting power
type TotalVotingPower = Epoched<VotingPower>; When any validator's voting power changes, we attempt to perform the following update on the ActiveValidatorSet: let validator be the validator's address, power_before and power_after be the voting power before and after the change, respectively let power_delta = power_after - power_before let min_active = active.first() (active validator with lowest voting power) let max_inactive = inactive.last() (inactive validator with greatest voting power) find whether the validator is active, let is_active = power_before >= max_inactive.voting_power if is_active: if power_delta > 0 && power_after > max_inactive.voting_power, update the validator in active set with voting_power = power_after else, remove the validator from active, insert it into inactive and remove max_inactive.address from inactive and insert it into active else (!is_active): if power_delta < 0 && power_after < min_active.voting_power, update the validator in inactive set with voting_power = power_after else, remove the validator from inactive, insert it into active and remove min_active.address from active and insert it into inactive Within each validator's address space, we store public consensus key, state, total bonded token amount and voting power calculated from the total bonded token amount (even though the voting power is stored in the ValidatorSet, we also need to have the voting_power here because we cannot look it up in the ValidatorSet without iterating the whole set): struct Validator { consensus_key: Epoched<PublicKey>, state: Epoched<ValidatorState>, total_deltas: Epoched<token::Amount>, voting_power: Epoched<VotingPower>,
} enum ValidatorState { Inactive, Pending, Candidate,
} The bonds and unbonds are keyed by their identifier: type Bonds = HashMap<BondId, Epoched<Bond>>;
type Unbonds = HashMap<BondId, Epoched<Unbond>>; struct BondId { validator: Address, /// The delegator adddress for delegations, or the same as the `validator` /// address for self-bonds. source: Address,
} struct Bond { /// A key is a the epoch set for the bond. This is used in unbonding, where // it's needed for slash epoch range check. deltas: HashMap<Epoch, token::Amount>,
} struct Unbond { /// A key is a pair of the epoch of the bond from which a unbond was created /// the epoch of unboding. This is needed for slash epoch range check. deltas: HashMap<(Epoch, Epoch), token::Amount>
} For slashes, we store the epoch and block height at which the fault occurred, slash rate and the slash type: struct Slash { epoch: Epoch, block_height: u64, /// slash token amount â€± (per ten thousand) rate: u8, r#type: SlashType,
}

