) -> bool { // Returning `true` allows any key change true
} You can think of it as its main function. When this VP is deployed to an account, this function will be called for every transaction that: Modifies a storage key that contains the account's address to which the validity predicate belongs Inserts the account's address into the verifier set with tx_prelude::insert_verifiers function Inside the validity predicate function, you can read any storage value with the functions provided in the vp_prelude from the storage prior to the transaction (functions with name suffix _pre) and from the storage state after the transaction is applied (suffixed with _post). To find out about the host interface available in a validity predicate, please check out Rust docs for vp_prelude . To compile the validity predicate's code from the template: make -C wasm/vp_template This will output a WASM file that can be found in wasm/vp_template/target/wasm32-unknown-unknown/release/vp_template.wasm. You can, for example, copy it into your wasm directory (the default directory used by the ledger's node and the client, which can be changed with --wasm-dir global argument or ANOMA_WASM_DIR): cp \ wasm/vp_template/target/wasm32-unknown-unknown/release/vp_template.wasm \ wasm/my_vp.wasm To submit a transaction that updates an account's validity predicate: anoma client update --address my-new-acc --code-path my_vp.wasm

