The DB keys are composed of key segments. A key segment can be an Address which starts with # (there can be multiple addresses involved in a key) or any user defined non-empty utf-8 string (maybe limited to only alphanumerical characters). Also, / and ? are reserved. / is used as a separator for segments. ? is reserved for a validity predicate and the key segment ? can be specified only by the specific API. In the DB storage, the keys would be prefixed by the block height and the space type. This would be hidden from the wasm environment, which only operates at the current block height. For example, when the block height is 123 and the key specified by the storage is #my_address_hash/balance/token, the actual key for the persistent DB implementation would be 123/subspace/#my_address_hash/balance/token. This could roughly be implemented as: struct Key { segments: Vec<DbKeySeg>
} impl Key { fn parse(string: String) -> Result<Self, Error> {..} fn push(&self, other: &KeySeg) -> Self {..} fn join(&self, other: &Key) -> Self {..} fn into_string(&self) -> String; // find addresses included in the key, used to find which validity-predicates should be triggered by a key space change fn find_addresses(&self) -> Vec<Address> {..}
} // Provide a trait so that we can define new pre-defined key segment types inside wasm environment and also ad-hoc key segments defined by wasm users
trait KeySeg { fn parse(string: String) -> Result<Self, Error>; fn to_string(&self) -> String; fn to_db_key(&self) -> DbKeySeg;
} enum DbKeySeg { AddressSeg(Address), StringSeg(String),
} impl KeySeg for DbKeySeg {..}
impl KeySeg for BlockHeight {..} Then the storage API functions (read/write/delete) should only accept the keys with this Key type.

